        <h1>zczxz</h1>
      </div>
      <div id="right">
            <div id="showcase">
                <div className="showcase-content">
                    <h1 className="showcase-text">Anime is Life, Feel it</h1>
                </div>
                </div>
                </div>
    </div>
    </>
  );
}

export default Home;
